```ts
async function generateShouldRespond(...): Promise<"RESPOND" | "IGNORE" | "STOP" | null> {
    while (true) {  // <-- This never stops
        try {
            const response = await generateText(...);
            const parsedResponse = parseShouldRespondFromText(response.trim());
            if (parsedResponse) {
                return parsedResponse;  // Only returns if it gets a valid response
            }
            // If response isn't valid, it keeps looping
        } catch (error) {
            // Even errors don't stop it
        }
        await new Promise((resolve) => setTimeout(resolve, retryDelay));
        retryDelay *= 2;
    }
}```

